import "../styles/cart.css";

const Cart = () => {
  return (
    <div className="cart">
      <h1>Your Cart</h1>
      <div className="container">
        <div className="two">
          {cart}
          <p>
            Lorem ipsum dolor sit, amet consectetur adipisicing elit. Iure odit
            reiciendis nemo maiores officia cumque libero excepturi minima vel.
            Accusantium dolorem inventore voluptate sunt officia, deleniti
            doloribus praesentium odio! Omnis.
          </p>
        </div>
        <div className="one">
          <p>
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Fuga
            tempore molestias maiores animi possimus! Sapiente ratione
            distinctio non temporibus? Soluta sed a dicta repudiandae quos
            repellendus nisi possimus vitae ducimus!
          </p>
        </div>
      </div>
    </div>
  );
};

export default Cart;
